        //when
        Village village = factory.withResourceFields(resourceFieldsHtml)
                .withStockBar(stockBarHtml)
                .withVillageCenterFactory(villageCenterHtml);

        //then
        var expectedStock = new VillageStock(3100, 2300, 658, 35, 491, 431, 533);

        SoftAssertions.assertSoftly(soft -> {
            soft.assertThat(village.getStock()).isEqualTo(expectedStock);
            soft.assertThat(village.getResourceFields()).hasSize(18);
            //select(res -> res.getType() == LUMBER))
            soft.assertThat(village.getResourceFields())
                    .filteredOn("type", LUMBER)
                    .hasSize(4)
                    .extracting("level", "id")
                    .containsExactlyInAnyOrder(
                            tuple(2, 1),
                            tuple(0, 3),
                            tuple(0, 14),
                            tuple(0, 17)
                    );
            soft.assertThat(village.getResourceFields())
                    .filteredOn("type", IRON)
                    .hasSize(4)
                    .extracting("level", "id")
                    .containsExactlyInAnyOrder(
                            tuple(0, 4),
                            tuple(0, 7),
                            tuple(0, 10),
                            tuple(0, 11)
                    );
            soft.assertThat(village.getResourceFields())
                    .filteredOn("type", CLAY)
                    .hasSize(4)
                    .extracting("level", "id")
                    .containsExactlyInAnyOrder(
                            tuple(1, 5),
                            tuple(0, 6),
                            tuple(2, 16),
                            tuple(0, 18)
                    );
            soft.assertThat(village.getResourceFields())
                    .filteredOn("type", CROP)
                    .hasSize(6)
                    .extracting("level", "id")
                    .containsExactlyInAnyOrder(
                            tuple(2, 2),
                            tuple(0, 8),
                            tuple(0, 12),
                            tuple(0, 9),
                            tuple(0, 15),
                            tuple(0, 13)
                    );
            soft.assertThat(village.getBuildings())
                    .filteredOn(building -> building.getType() != BuildingType.EMPTY_SLOT)
                    .extracting("type", "level", "id")
                    .containsExactlyInAnyOrder(
                            tuple(WAREHOUSE, 2, 21),
                            tuple(GRANARY, 2, 22),
                            tuple(MAIN_BUILDING, 1, 26),
                            tuple(RALLY_POINT, 1, 39)
                    );
        });
